Verenigde Staten
Western / Drama
110 minuten

goed

met Jeff Bridges, Hailee Steinfeld en Matt Damon

Nadat ze ziet hoe haar vader vermoord wordt door Tom Chaney besluit de 14-jarige Mattie Ross deze moordenaar te vangen. Ze 
huurt de taaiste U.S. marshall, J. &quot;Rooster&quot; Cogburn, om haar te helpen. Mattie staat erop dat ze meereist met Cogburn, wiens 
drinkgedrag, luiigheid en algemeen veroordelend karakter haar vertrouwen in hem niet vergroot. Tegen zijn wil reist ze met hem 
mee door de Indiaanse streken om Chany te zoeken. Ze worden bijgestaan door Texas Ranger LaBoeuf, die Chaney wil hebben voor 
andere doeleinden. Dit onwaarschijnlijk trio staat vele gevaren en verrassingen te wachten op hun reis.
